import React from 'react';
import { FaMapMarkerAlt, FaPhoneAlt, FaEnvelope } from "react-icons/fa";

const ContactUs = () => {
  return (
    <section className="bg-white py-12 px-6">
      <div className="max-w-7xl mx-auto grid grid-cols-1 md:grid-cols-2 gap-12 items-center">
        {/* Left Side - Contact Form */}
        <div className="bg-gray-100 p-8 rounded-xl shadow-md">
          <h2 className="text-2xl font-semibold text-gray-700 mb-6">Get in Touch</h2>
          <form className="space-y-4">
            <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
              <input type="text" placeholder="Name" className="w-full p-3 border border-gray-300 rounded" />
              <input type="email" placeholder="E-mail" className="w-full p-3 border border-gray-300 rounded" />
            </div>
            <input type="text" placeholder="Subject" className="w-full p-3 border border-gray-300 rounded" />
            <textarea placeholder="Message" className="w-full p-3 border border-gray-300 rounded h-32"></textarea>
            <button className="w-full bg-purple-700 text-white py-3 rounded hover:bg-purple-800">Send Message</button>
          </form>
        </div>

        {/* Right Side - Contact Details */}
        <div className="space-y-6">
          {/* Phone */}
          <div className="flex items-center space-x-4">
            <div className="bg-purple-700 text-white p-4 rounded-full">
              <FaPhoneAlt className="text-2xl" />
            </div>
            <div>
              <h3 className="text-lg font-semibold">Call Us</h3>
              <p className="text-gray-600">+91 9929146888</p>
              <p className="text-gray-600">+91 8560972212</p>
            </div>
          </div>
          
          {/* Email */}
          <div className="flex items-center space-x-4">
            <div className="bg-purple-700 text-white p-4 rounded-full">
              <FaEnvelope className="text-2xl" />
            </div>
            <div>
              <h3 className="text-lg font-semibold">Message</h3>
              <p className="text-gray-600">yourva@unfirstassistant.com</p>
            </div>
          </div>
          
          {/* Address */}
          <div className="flex items-center space-x-4">
            <div className="bg-purple-700 text-white p-4 rounded-full">
              <FaMapMarkerAlt className="text-2xl" />
            </div>
            <div>
              <h3 className="text-lg font-semibold">Our Location</h3>
              <p className="text-gray-600 font-semibold">Registered Address:</p>
              <p className="text-gray-600">R.H.B. Colony, 4/4/11 Sector 14, Udaipur, Rajasthan 313002</p>
              <p className="text-gray-600 font-semibold mt-2">HQ Office:</p>
              <p className="text-gray-600">Plot Number 25, Main Road, Shakti Nagar, Udaipur, Rajasthan 313001</p>
              <p className="text-gray-600 font-semibold mt-2">Canada Office:</p>
              <p className="text-gray-600">1735 Riverbrook Crescent, Mississauga, L5M6A1, Ontario, Canada</p>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default ContactUs;
